package cybertek;

public class MultiBranchIf {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int score = 60;
		
		
		if (score >= 90) {
			System.out.println("A");
		}
		
		else if (score>=80)
		{
			System.out.println("B");
		}
		
		else if (score >=70)
		{
			System.out.println("C");
		}
			
		else System.out.println("Study Harder");
		
		
		
	}

}
